import "./App.css";

function App() {
  let age = 0;
  function increaseAge() {
    age += 1;
    console.log(age);
  }

  return (
    <div className="App">
      <p>{age}</p>
      <button onClick={increaseAge()}>increase</button>
    </div>
  );
}

export default App;
